package kr.co.mooi.statis.domain;

public class StatisDate {

	String start;
	String end;
	
	
	
	public StatisDate() {
		super();
		// TODO Auto-generated constructor stub
	}


	public StatisDate(String start, String end) {
		super();
		this.start = start;
		this.end = end;
	}


	public String getStart() {
		return start;
	}


	public void setStart(String start) {
		this.start = start;
	}


	public String getEnd() {
		return end;
	}


	public void setEnd(String end) {
		this.end = end;
	}
	
	
	
}
